// (LeetCode) 389. Find the Difference

var findTheDifference = function (s, t) {
  let mapS = new Map()
  let mapT = new Map()

  mapS = mapping(s)
  mapT = mapping(t)

  let result = ''
  mapT.forEach((valueT, keyT) => {
    if (mapS.has(keyT) === false || mapS.get(keyT) < valueT) {
      result = keyT
    }
  })

  return result
}

var mapping = prev => {
  let map = new Map()

  for (let i = 0; i <= prev.length; i++) {
    let counter = 1
    for (let j = i + 1; j <= prev.length; j++) {
      if (prev[i] == prev[j]) ++counter

      if (!map.has(prev[i]) && j === prev.length) {
        map.set(prev[i], counter)
      }
    }
  }

  return map
}

